import React from 'react';
import FavoriteRoundedIcon from '@material-ui/icons/FavoriteRounded';
import IconButton from '@material-ui/core/IconButton';
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import ShareRoundedIcon from '@material-ui/icons/ShareRounded';
import MoreVertRoundedIcon from '@material-ui/icons/MoreVertRounded';
import "./Cardext.css";

function CardMusic(props) {
    return (
        <div>
            <div className="card container p-0 border-black">
                <img src="https://source.unsplash.com/As8zq82LBpw/300x300" className="card-img-top imge h-50"></img>
                <div className="card-body h-25">
                    <p>{props.nameOfSong}</p>
                    <p>{props.nameOfSinger}</p>
                </div>
                <div className="card-footer h-25">
                    <IconButton>
                        <FavoriteRoundedIcon color="action"/>
                    </IconButton>
                    <IconButton>
                        <ShareRoundedIcon color="primary"/>
                    </IconButton>
                    <IconButton className="float-right">
                        <MoreVertRoundedIcon color="secondary"/>
                    </IconButton>
                </div>
            </div>
        </div>
    );
}

export default CardMusic;
